INSERT INTO `eventos` (`id`, `name`, `description`, `photo`, `status`, `user_id`, `organizer`, `location`, `dateEvent`, `slug`, `donaciones`) VALUES
(1, 'EL CLUB DE LA COMEDIA', 'Se organizará fiestas a sus residentes en Halloween, Navidad, el último sábado de cada mes y en cumpleaños. Lo que hacemos es ir allí y montarles fiestas con música, gymkanas con juegos, actuaciones de cumpleaños o cualquier otra cosa que se nos ocurre dependiendo del momento y la satisfacción para nosotros es tan grande que no sólo nos está aportando beneficios este nuevo servicio sino que también nos está trayendo beneficios personales. Ver la cara de los ancianos riendo y jugando es todo un orgullo para nosotros.', 'http://happyelder.pe/uploads/I5.jpg', 'publish', 13, 'Nico Quispe', 'Lima', '2018-09-15 05:00:00', 'el-club-de-la-comedia', 2),
(2, 'VENTAS PARA GANADORES - SEMINARIO INTERNACIONAL', 'Vive la experiencia a través del Diseño, Interiores y Fotografía.\r\n\r\nVive la experiencia a través del Diseño, Marketing y Fotografía\r\n\r\nAsiste a nuestros talleres gratuitos en:\r\n\r\n- Foto: Fotografía de producto\r\n- Diseño: La imagen comunica\r\n- Interiores: Accesorios y complementos decorativos\r\n\r\n\r\nHora: 6:30 pm\r\nFecha: 22 de agosto\r\nLugar: Sede Lima Sur, en el C.C Plaza Lima Sur (frente a la granjita)', 'https://s3-us-west-2.amazonaws.com/joinnus.com/user/21289/act5b560534b8fbf.jpg', 'trash', 1, 'asdasd', 'asdasdasd', '0000-00-00 00:00:00', 'ventas-para-ganadores-seminario-internacional', 0),
(8, 'Eres Más - Lima Sur', 'Vive la experiencia a través del Diseño, Interiores y Fotografía.\n\nVive la experiencia a través del Diseño, Marketing y Fotografía\n\nAsiste a nuestros talleres gratuitos en:\n\n- Foto: Fotografía de producto\n- Diseño: La imagen comunica\n- Interiores: Accesorios y complementos decorativos\n\n\nHora: 6:30 pm\nFecha: 22 de agosto\nLugar: Sede Lima Sur, en el C.C Plaza Lima Sur (frente a la granjita)', 'https://s3-us-west-2.amazonaws.com/joinnus.com/user/21289/act5b560534b8fbf.jpg', 'trash', 1, '', '', '0000-00-00 00:00:00', 'event-3', 0),
(9, 'Evento Gratuito: NETWORKING CREATIVO', 'Vive la experiencia a través del Diseño, Interiores y Fotografía.\n\nVive la experiencia a través del Diseño, Marketing y Fotografía\n\nAsiste a nuestros talleres gratuitos en:\n\n- Foto: Fotografía de producto\n- Diseño: La imagen comunica\n- Interiores: Accesorios y complementos decorativos\n\n\nHora: 6:30 pm\nFecha: 22 de agosto\nLugar: Sede Lima Sur, en el C.C Plaza Lima Sur (frente a la granjita)', 'https://s3-us-west-2.amazonaws.com/joinnus.com/user/21289/act5b560534b8fbf.jpg', 'trash', 1, '', '', '0000-00-00 00:00:00', 'event-4', 0),
(13, 'DADDY YANKEE | TOUR DURA', 'Vive la experiencia a través del Diseño, Interiores y Fotografía.\n\nVive la experiencia a través del Diseño, Marketing y Fotografía\n\nAsiste a nuestros talleres gratuitos en:\n\n- Foto: Fotografía de producto\n- Diseño: La imagen comunica\n- Interiores: Accesorios y complementos decorativos\n\n\nHora: 6:30 pm\nFecha: 22 de agosto\nLugar: Sede Lima Sur, en el C.C Plaza Lima Sur (frente a la granjita)', 'https://s3-us-west-2.amazonaws.com/joinnus.com/user/21289/act5b560534b8fbf.jpg', 'trash', 1, '', '', '0000-00-00 00:00:00', 'event-5', 0),
(14, 'dfg', 'dfgdfgd', 'http://happyelder.pe/uploads/unnamed_2.png', 'trash', 13, 'fgdfg', 'fdgdfgdf', '2018-02-05 05:00:00', 'dfg', 0),
(15, 'Talleres de Verano para Adultos Mayores', 'En el transcurso de cada jornada participarán de talleres de música, tango, plástica, yoga, caminatas, gimnasia de bajo impacto (Acqua Gym), y  actividades especiales ( intergeneracionales, almuerzos recreativos, fiestas de disfraces y temáticas, entre otras).', 'http://happyelder.pe/uploads/I6.JPG', 'publish', 16, 'Diego Carlos', 'Lima', '2018-10-15 05:00:00', 'talleres-de-verano-para-adultos-mayores', 0),
(16, 'Festejo de cumpleanhos', 'El día 20 de Septiembre celebramos los cumpleaños de todos los residentes que han cumplido años en el ultimo mes. Felicidades a todos!!', 'http://happyelder.pe/uploads/I7.jpg', 'publish', 1, 'Yesenia Olivares', 'Lima', '2018-09-20 05:00:00', 'festejo-de-cumpleanhos', 0),
(17, 'Integrador 222', 'Integrador 2', 'http://happyelder.pe/uploads/1.jpg', 'trash', 1, 'Yamil', 'Lima', '2018-10-30 21:25:54', 'integrador-222', 0),
(18, 'La feria de los juegos', 'Uno de los miembros del grupo elige un objeto diciendo la letra por la que empieza. Los demás participantes van diciendo posibles objetos hasta que lo identifican. La persona que elige el objeto puede dar pistas e informar sobre el lugar de la sala en el que se encuentra si los compañeros no consiguen adivinarlo.', 'http://happyelder.pe/uploads/I36.jpg', 'publish', 34, 'Yamil Quiñones', 'Universidad Tecnologica del Perú', '2018-11-01 05:00:00', 'la-feria-de-los-juegos', 0),
(19, 'Evento 1', 'Evento 1', 'http://happyelder.pe/uploads/C1.jpg', 'publish', 16, 'Diego', 'Universidad Tecnologica del Perú', '2018-11-08 21:38:41', 'evento-1', 1),
