(1, 'Cuidador responsable de ancianos a domicilio', 'Hola soy auxiliar de. Enfermería nacionalidad colombiana experiencia en salud ; hospitales , clinicas ; cuidado de niños y adultos mayores ! hace aproximadamente 8 años. Tengo 28 años de edad tengo buena actitud para desempeñarme soy una amable; respetuosa y muy ...', 'https://www.cronoshare.com/assets/avatar-pro/elderly/9-d599bf44f437fdb45a85e4c598f5cebb.jpg', 'trash', '', 0, 13, 'service--1', 0, '0000-00-00', '2018-10-28 23:46:06'),
(2, 'Cuidador profesional de ancianos a domicilio', 'Cuidado de personas mayores, 10 años de experiencia con referencia, actualmente estoy estudiando curso de geriatria', 'http://happyelder.pe/uploads/I3.jpg', 'reservado', '7:00 am a 5:00 pm', 70, 13, 'cuidador-profesional-de-ancianos-a-domicilio', 12, '2018-09-21', '2018-10-28 23:46:06'),
(3, 'Cuidador puntual de ancianos a domicilio', 'Vive la experiencia a través del Diseño, Interiores y Fotografía.\n\nVive la experiencia a través del Diseño, Marketing y Fotografía\n\nAsiste a nuestros talleres gratuitos en:\n\n- Foto: Fotografía de producto\n- Diseño: La imagen comunica\n- Interiores: Accesorios y complementos decorativos\n\n\nHora: 6:30 pm\nFecha: 22 de agosto\nLugar: Sede Lima Sur, en el C.C Plaza Lima Sur (frente a la granjita)Camarero en 100 montaditos 2 años, ayudante de camarero hotel don sancho, cafeteria restaurante tertulia.', 'https://www.cronoshare.com/assets/avatar-pro/elderly/10-874dcca5c55bcc183381c1b4ee2a4780.jpg', 'trash', '', 0, 1, 'service--3', 0, '0000-00-00', '2018-10-28 23:46:06'),
(4, 'Cuidador por horas de ancianos a domicilio', 'Hola soy victoria tengo papeles experiencias referencias en el cuidado de mayores para fines de semanas y festivos llama al disponibilidad de inmediata', 'http://happyelder.pe/uploads/I2.jpg', 'reservado', '4:00 pm a 8:00 pm', 50, 13, 'cuidador-por-horas-de-ancianos-a-domicilio', 41, '2018-11-22', '2018-10-28 23:46:06'),
(6, 'Cuidador para ancianos a domicilio', 'He trabajado aqui en madrid como profesora de ingles desde 2007. Trabajo en empresas con grupos o individuales y tambien con clases telefonicas y con una plataforma de internet. Tengo alumnos del infantil hasta pensionistas. Alumno mas pequeno es 1,5 anos y mas major... ', 'https://www.cronoshare.com/assets/avatar-pro/elderly/6-2fb244d6bb4154691527cc32e78b946e.jpg', 'trash', '', 0, 1, 'service--5', 0, '0000-00-00', '2018-10-28 23:46:06'),
(7, 'Cuidador por horas de ancianos a domicilio', 'En geriátrico, limpieza de a citaciones, y zonas comunes, y trabaje en lavandería , y en comedor, estuve también de camarera ,', 'https://www.cronoshare.com/assets/avatar-pro/elderly/7-2526aeed7b969e39f6a0fde626b2ff1f.jpg', 'trash', '', 0, 1, 'service--6', 0, '0000-00-00', '2018-10-28 23:46:06'),
(8, 'Cuidador responsable de ancianos a domicilio', 'Vive la experiencia a través del Diseño, Interiores y Fotografía.\n\nVive la experiencia a través del Diseño, Marketing y Fotografía\n\nAsiste a nuestros talleres gratuitos en:\n\n- Foto: Fotografía de producto\n- Diseño: La imagen comunica\n- Interiores: Accesorios y complementos decorativos\n\n\nHora: 6:30 pm\nFecha: 22 de agosto\nLugar: Sede Lima Sur, en el C.C Plaza Lima Sur (frente a la granjita)Buenos dias, soy bulgara con 15 años de experiencia en la cocina española, cocino muy bien, tambien tengo titulo de auxiliar de gueriatria. Me interesa esta oferta de empleo grasias!', 'https://www.cronoshare.com/assets/avatar-pro/elderly/2-25436b8d331745e67bce21f1886ee6e5.jpg', 'trash', '', 0, 1, 'service--7', 0, '0000-00-00', '2018-10-28 23:46:06'),
(10, 'Ofrezco atención por horas para personas  mayores', 'Para ayudarles en su movilidad, como acompañamiento, como apoyo al aseo personal, a vestir y desvestir, administración de medicamentos, limpieza del domicilio, preparación de comidas puedes contar con las cuidadoras profesionales por horas de Interdomicilio.', 'http://happyelder.pe/uploads/I4.jpg', 'reservado', '10:00 am a 6:00 pm', 89, 1, 'ofrezco-atencion-por-horas-para-personas-mayores', 42, '2018-11-20', '2018-10-28 23:46:06'),
(11, 'asdasda sdas asd asdasdasdas dasd', 'sda sdas dasda', '', 'trash', 'asda asd asd as', 2323222, 1, 'asdasda-sdas-asd-asdasdasdas-dasd', 0, '0000-00-00', '2018-10-28 23:46:06'),
(12, 'asda sdas dasd a', 'sd asda sdasd', 'http://happyelder.pe/uploads/unnamed.png', 'trash', 'asdqe qwd asdas', 323, 13, 'asda-sdas-dasd-a', 0, '0000-00-00', '2018-10-28 23:46:06'),
(13, 'Ama de Casa', 'Enfocado para mayores de edad de 60 años que tengan necesidad de asistencia con por lo menos 2 actividades de la vida cotidiana', 'http://happyelder.pe/uploads/I1.jpg', 'reservado', '8:00 am a 8:00 pm', 100, 15, 'ama-de-casa', 43, '2018-11-17', '2018-10-28 23:46:06'),
(14, 'Prestaciones medicas para ancianos', 'Se ofrece un seguro a largo plazo', 'http://happyelder.pe/uploads/I8.jpg', 'reservado', '4:00 pm a 7:00 pm', 40, 16, 'prestaciones-medicas-para-ancianos', 18, '2018-11-29', '2018-10-28 23:46:06'),
(16, 'Cuidadora interna entre semana', 'Con el servicio Interna Entre Semana, dispondrás de una cuidadora interna dedicada exclusivamente a la atención de tu mayor, que se adaptará perfectamente a su personalidad y costumbres diarias.\r\n\r\nTu ser querido podrá seguir en su casa con la máxima atención, seguridad, tranquilidad y confort, sin que tú pierdas ninguna información sobre la evolución de su salud.', 'http://happyelder.pe/uploads/I13.jpg', 'reservado', '9:00 am a 10:00 pm', 80, 27, 'cuidadora-interna-entre-semana', 23, '2018-11-17', '2018-10-28 23:46:06'),
(17, 'Cuidadora interna en medio de semana', 'Con el servicio Interna Entre Semana, dispondrás de una cuidadora interna dedicada exclusivamente a la atención de tu mayor, que se adaptará perfectamente a su personalidad y costumbres diarias.\r\n\r\nTu ser querido podrá seguir en su casa con la máxima atención, seguridad, tranquilidad y confort, sin que tú pierdas ninguna información sobre la evolución de su salud.', '', 'trash', '9:00 am a 10:00 pm', 80, 27, 'cuidadora-interna-en-medio-de-semana', 0, '0000-00-00', '2018-10-28 23:46:06'),
(22, 'Servicios para fin de semana', 'Se ofrece acompañamiento durante todo el fin de semana, para que la persona mayor se sienta acompañada y con total seguridad.\r\n\r\nLa solución perfecta para que puedas disponer de todos los sábados y domingos sin ninguna preocupación, mientras tu mayor está atendido y cuidado con la máxima dedicación y profesionalidad por uno de nuestros mejores cuidadores.', 'http://happyelder.pe/uploads/I13.jpg', 'trash', '8:00 am a 6:00 pm', 100, 25, 'servicios-para-fin-de-semana', 28, '2018-09-28', '2018-10-28 23:46:06'),
(23, 'Servicios de todo un fin de semana', 'Una cuidadora interna es una profesional del cuidado de mayores con referencias válidas, además de experiencia y formación previa.', 'http://happyelder.pe/uploads/I14.jpg', 'reservado', '6:00 am a 7:00 pm', 75, 27, 'servicios-de-todo-un-fin-de-semana', 41, '2018-11-15', '2018-10-28 23:46:06'),
(24, 'ejemplo1', 'ddf', '', 'trash', '8:00 am a 8:00 pm', 490, 16, 'ejemplo1', 28, '2018-09-18', '2018-10-28 23:46:06'),
(25, 'prueba2', 'prueba', '', 'trash', '7:00 am a 5:00 pm', 34, 16, 'prueba2', 28, '2018-09-20', '2018-10-28 23:46:06'),
(26, 'prueba3', '3', '', 'trash', '8:00 am a 8:00 pm', 34, 16, 'prueba3', 28, '2018-09-15', '2018-10-28 23:46:06'),
