(29, 'Cuidados básicos', 'El aseo e higiene personal ayuda a las personas a relajarse y prevenir enfermedades, por lo que te prestaremos el apoyo necesario para el día a día.', 'http://happyelder.pe/uploads/I15.jpg', 'reservado', '7:00 am a 6:00 pm', 90, 15, 'cuidados-basicos', 42, '2018-11-26', '2018-10-28 23:46:06'),
(30, 'Servicios de carácter rehabilitador', 'Prestado por personal cualificado, para facilitar, mantener o devolver el mayor grado de capacidad funcional e independencia posible, en personas con el riesgo de desarrollar una discapacidad.', 'http://happyelder.pe/uploads/I16.jpg', 'reservado', '6:00 am a 4:00 pm', 110, 15, 'servicios-de-caracter-rehabilitador', 43, '2018-11-30', '2018-10-28 23:46:06'),
(31, 'Navidad', '...', 'http://happyelder.pe/uploads/1.jpg', 'trash', '8:00 am a 8:00 pm', 100, 34, 'navidad', 18, '2018-10-08', '2018-10-28 23:46:06'),
(32, '3443', '4334', '', 'trash', '34dfg', 0, 24, '3443', 0, '0000-00-00', '2018-10-28 23:46:06'),
(33, 'Apoyo con la agilidad manual', 'Esta actividad puede ser muy variada, desde pintar mandalas o colorear figuras, hasta realizar cuadros sobre lienzo o en diferentes superficies como azulejos.\r\nEste ejercicio potencia la agilidad manual y de nuevo contribuye a mantener la atención y concentración. Además fomenta la autoestima y autosatisfacción.', 'http://happyelder.pe/uploads/I34.jpg', 'reservado', '8:00 am a 1:00 pm', 50, 32, 'apoyo-con-la-agilidad-manual', 44, '2018-11-26', '2018-10-30 21:29:24'),
(34, 'Agilidad a la memoria', 'Colocamos todas las cartas de una baraja boca abajo formando 4 filas y 13 columnas. El primer jugador levantará dos cartas al azar. Si coinciden, las guardará y continuará jugando. Si los números son diferentes, tendrá que ponerlas de nuevo boca abajo y el turno pasará al siguiente jugador. El jugador que haya conseguido el mayor número de pares al final del juego ganará la partida.', 'http://happyelder.pe/uploads/I35.jpg', 'reservado', '10:00 am a 1:00 pm', 40, 32, 'agilidad-a-la-memoria', 43, '2018-11-05', '2018-10-30 21:31:43'),
(35, 'Cuidado Diurno(de dia)', 'Servicios de cuidado diurno(de dia) para ancianos de 60 años o mayores que esten en necesidad de por lo menos 2 actividades de la vida cotidiana.  Prioridad es dada a aquellos que estan socialmente aislados y en desventajas financiera.  Programas de cuidado diurno(de dia) ofrecen actividades de recreacion supervisadas, interaccion social, y comidas nutritivas y bocadillos.', 'http://happyelder.pe/uploads/I37.jpg', 'reservado', '8:00 am a 8:00 pm', 0, 34, 'cuidado-diurnode-dia', 46, '2018-11-15', '2018-10-30 21:49:19'),
(36, 'Atención domiciliaria', 'Atención integral y personalizada a personas, especialmente personas mayores, y familias que presentan alguna dificultad para sus actividades\r\nbásicas o para su desarrollo personal y social.', 'http://happyelder.pe/uploads/I38.jpg', 'reservado', '8:00 am a 2:00 pm', 56, 15, 'atencion-domiciliaria', 44, '2018-12-03', '2018-11-03 00:18:00'),
(37, 'Comidas en compañia', 'Servicio de comedor para la alimentación adecuada y espacio de relación social para personas mayores en situación de fragilidad.', 'http://happyelder.pe/uploads/I39.jpg', 'reservado', '1:00 pm  a 3:00 pm', 40, 15, 'comidas-en-compania', 46, '2018-11-06', '2018-11-03 00:18:55'),
(38, 'Programa "Vivir y convivir"', 'Programa destinado a personas mayores que se valen por sí mismas y que pueden ofrecer una habitación y a estudiantes universitarios que necesitan vivienda, para que se ayuden mutuamente.', 'http://happyelder.pe/uploads/I40.jpg', 'reservado', '9:00 am a 1:00 pm', 58, 15, 'programa-vivir-y-convivir', 41, '2018-11-30', '2018-11-03 00:19:58'),
(39, 'Acompañamiento a domicilio para las personas mayores', 'Servicio de voluntariado para el apoyo afectivo, aligeramiento de la situación de aislamiento y acompañamiento para gestiones fuera del domicilio, tanto continuado como esporádico.', 'http://happyelder.pe/uploads/I41.jpg', 'reservado', '8:00 am a 1:00 pm', 0, 16, 'acompanamiento-a-domicilio-para-las-personas-mayores', 18, '2018-11-23', '2018-11-03 00:35:56'),
(40, 'Reparaciones Menores Para El Hogar', 'Reparaciones menores para el hogar son disponibles para ancianos de 60 años de edad o mayores que estan en necesidad de asistencia con por lo menos 2 actividades de la vida cotidiana. La prioridad es dada a aquellos que estan socialmente aislados y en desventaja financiera.', 'http://happyelder.pe/uploads/I42.jpg', 'reservado', '8:00 am a 2:00 pm', 0, 16, 'reparaciones-menores-para-el-hogar', 18, '2018-11-15', '2018-11-03 00:38:57'),
(41, 'Servicios "Vincles"', 'Servicio que quiere reforzar las relaciones sociales de las personas mayores que se sienten solas y mejorar su bienestar a través de las nuevas tecnologías.', 'http://happyelder.pe/uploads/I42.jpeg', 'reservado', '9:00 am a 12:00 pm', 0, 16, 'servicios-vincles', 18, '2018-11-27', '2018-11-03 00:41:16'),
(42, 'Acogida diurna para las personas mayores', 'Centros de acogida durante el día para las personas mayores que no pueden estar solas en casa y necesitan ayuda para las actividades de la vida diaria.', 'http://happyelder.pe/uploads/I43.jpg', 'publish', '8:00 am a 10:00 pm', 150, 17, 'acogida-diurna-para-las-personas-mayores', 0, '0000-00-00', '2018-11-03 00:42:56'),
(43, 'Acogida de urgencia para personas mayores', 'Atención inmediata a personas mayores en situación de urgencia social de manera temporal.', 'http://happyelder.pe/uploads/I44.jpg', 'publish', '8:00 am a 2:30 pm', 80, 17, 'acogida-de-urgencia-para-personas-mayores', 0, '0000-00-00', '2018-11-03 00:44:05'),
(44, 'Ayudas técnicas para adaptación al hogar. Productos de apoyo', 'Asesoramiento, valoración, instalación y monitorización a través de un terapeuta ocupacional de aparatos para personas con falta de autonomía.', 'http://happyelder.pe/uploads/I45.jpg', 'publish', '8:00 am a 1:30 pm', 59, 17, 'ayudas-tecnicas-para-adaptacion-al-hogar-productos-de-apoyo', 0, '0000-00-00', '2018-11-03 00:45:23'),
(45, 'Comidas a domicilio', 'Entrega de comidas equilibradas y saludables para personas con una situación personal que lo requiera.', 'http://happyelder.pe/uploads/I46.jpg', 'publish', '12:00 pm a 3:00 pm', 0, 19, 'comidas-a-domicilio', 0, '0000-00-00', '2018-11-03 00:47:32'),
