(54, 'Servicios navideños', 'Se ofrece servicios el día 24 de Diciembre, en donde se cantarán villancicos, se apoyará al adulto mayor a salir a pasear,etc.\r\nLas fiesta navideñas suponen para las personas mayores un cambio de rutinas que puede afectar a su salud física y psicológica', 'http://happyelder.pe/uploads/navidades.jpg', 'publish', '1:00 pm  a 6:00 pm', 70, 27, 'servicios-navidenos', 0, '0000-00-00', '2018-12-03 05:48:16'),
(55, 'Decoraciones navideñas', 'Se apoyaran a los adultos mayores con la decoración de sus hogares', 'http://happyelder.pe/uploads/navi.png', 'publish', '8:00 am a 1:00 pm', 40, 27, 'decoraciones-navidenas', 0, '0000-00-00', '2018-12-03 05:49:43'),
(56, 'Disfrutemos de la navidad', 'Se dará un ambiente especial a la residencia, así como la decoración con adornos típicos de esta festividad.Muchos mayores les recuerda a cuando lo hacían en sus casas con sus familiares y les acerca a esa Navidad, por lo que suelen recibir esta actividad con bastante nostalgia y alegría.', 'http://happyelder.pe/uploads/navid.jpg', 'publish', '10:00 am a 1:00 pm', 50, 32, 'disfrutemos-de-la-navidad', 0, '0000-00-00', '2018-12-03 05:51:30');
