(1, 'Cuidador responsable de ancianos a domicilio', 'Hola soy auxiliar de. Enfermería nacionalidad colombiana experiencia en salud ; hospitales , clinicas ; cuidado de niños y adultos mayores ! hace aproximadamente 8 años. Tengo 28 años de edad tengo buena actitud para desempeñarme soy una amable; respetuosa y muy ...', 'https://www.cronoshare.com/assets/avatar-pro/elderly/9-d599bf44f437fdb45a85e4c598f5cebb.jpg', 'trash', '', 'location-1'),
(2, 'Cuidador profesional de ancianos a domicilio', 'Cuidado de personas mayores, 10 años de experiencia con referencia, actualmente estoy estudiando curso de geriatria', 'https://www.cronoshare.com/assets/avatar-pro/elderly/3-8898fc8df5f1ec7a18b89f543f002541.jpg', 'trash', '', 'location-2'),
(3, 'Residencia geriatrica', 'Descripción:Casa de Reposo el Roble, somos una institución comprometida con la atención y el cuidado del Adulto Mayor, conformada por un sólido equipo de profesionales: preparados para brindarles a nuestros residentes la atención y el cariño que sólo pueden esperar de sus seres queridos.', 'http://happyelder.pe/uploads/I9.jpg', 'publish', 'Calle Las Cascadas del Sol 240  Urb. El Sol de la Molina', 'residencia-geriatrica'),
(4, 'Casa de reposo y rehabilitacion', 'El Centro de Reposo y Rehabilitación La Molina, cuenta con 28 años de experiencia en el sector.\r\nDispone de instalaciones especialmente construidas para la atención del Adulto Mayor (área de recreación, área de visitas y área de oración).', 'http://happyelder.pe/uploads/I10.jpg', 'publish', 'Avenida Viña del Mar 135  Urb. Sol de La Molina - 1º Etapa', 'casa-de-reposo-y-rehabilitacion'),
(6, 'Cuidador para ancianos a domicilio', 'He trabajado aqui en madrid como profesora de ingles desde 2007. Trabajo en empresas con grupos o individuales y tambien con clases telefonicas y con una plataforma de internet. Tengo alumnos del infantil hasta pensionistas. Alumno mas pequeno es 1,5 anos y mas major... ', 'https://www.cronoshare.com/assets/avatar-pro/elderly/6-2fb244d6bb4154691527cc32e78b946e.jpg', 'trash', '', 'location-5'),
(7, 'Cuidador por horas de ancianos a domicilio', 'En geriátrico, limpieza de a citaciones, y zonas comunes, y trabaje en lavandería , y en comedor, estuve también de camarera ,', 'https://www.cronoshare.com/assets/avatar-pro/elderly/7-2526aeed7b969e39f6a0fde626b2ff1f.jpg', 'trash', '', 'location-6'),
(8, 'Cuidador responsable de ancianos a domicilio', 'Vive la experiencia a través del Diseño, Interiores y Fotografía.\n\nVive la experiencia a través del Diseño, Marketing y Fotografía\n\nAsiste a nuestros talleres gratuitos en:\n\n- Foto: Fotografía de producto\n- Diseño: La imagen comunica\n- Interiores: Accesorios y complementos decorativos\n\n\nHora: 6:30 pm\nFecha: 22 de agosto\nLugar: Sede Lima Sur, en el C.C Plaza Lima Sur (frente a la granjita)Buenos dias, soy bulgara con 15 años de experiencia en la cocina española, cocino muy bien, tambien tengo titulo de auxiliar de gueriatria. Me interesa esta oferta de empleo grasias!', 'https://www.cronoshare.com/assets/avatar-pro/elderly/2-25436b8d331745e67bce21f1886ee6e5.jpg', 'trash', '', 'location-7'),
(9, 'Centro geriatrico señor de los milagros', 'El Centro Geriátrico “Señor de los Milagros” se encuentra en CHOSICA, un lugar bendecido por su excelente clima.\r\nEl Centro Geriátrico se caracteriza por su alta calidad humana y profesionalismo.', 'http://happyelder.pe/uploads/I11.jpg', 'publish', 'Calle Micaela Bastidas 123  Urb. San Carlos - Alto Chosica', 'centro-geriatrico-senor-de-los-milagros'),
(10, 'Enfermeras Gloria', 'Somos CEG Gloria E.I.R.L., un reconocido centro de enfermería geriátrica que cuenta con especialistas en el cuidado y la atención integral del adulto mayor.\r\nEstamos ubicados en Cercado de Lima, contáctenos para asesorarlo en lo que necesite.', 'http://happyelder.pe/uploads/I12.jpg', 'publish', 'Avenida Alejandro Tirado 624  Urb. Santa Beatriz', 'enfermeras-gloria'),
(11, 'Casa de Reposo Marbella', 'Somos un centro geriátrico que marca la diferencia, contamos con personal especializado en cuidado del adulto mayor.\r\nSomos un centro geriátrico que marca la diferencia, contamos con personal especializado en cuidado del adulto mayor.\r\nServicios de:\r\n- Alojamiento permanente.\r\n- Atención médica especializada.\r\n- Atención de enfermería las 24 horas.\r\n- Alimentación balanceada.\r\n- Servicio de lavandería.\r\n- Terapia física.\r\n- Terapia ocupacional recreativa.', 'http://happyelder.pe/uploads/C3.jpg', 'publish', 'Calle Daniel Muñoz 275 Alt. Cdra. 5 de Julio Bailetti o por Cdra.33 de Javier Prado', 'casa-de-reposo-marbella'),
(12, 'Casa Alojamiento del Adulto Mayor "Cetebimp"', 'Brindamos servicios de alojamiento y cuidado para adultos mayores, nuestro compromiso es mejorar su calidad de vida.\r\nBrindamos servicios de alojamiento y cuidado para adultos mayores, nuestro compromiso es mejorar su calidad de vida e incentivarlos a seguir siendo valiosos para sus familias. Ponemos a su disposición profesionales con una alta vocación de servicio, ambientes agradables y acogedores, actividades de integración social, de recreación (paseos turísticos).\r\nNuestras instalaciones les brinda la posibilidad de contar con terapias ocupacionales, controles médicos y nutricionales, compartirán juego de salón, manualidades, televisión por cable, internet, entre otros.', 'http://happyelder.pe/uploads/C4.JPG', 'publish', 'Calle Chamochumbi 236 (A la Espalda de la Iglesia San Miguel de Arcángel)', 'casa-alojamiento-del-adulto-mayor-cetebimp'),
(13, 'Casa de Reposo Dedik2 Con Amor', 'Brindamos atención profesional y cuidados al adulto mayor con mucho amor.\r\nOfrecemos atención mixta al adulto mayor en todas sus patologías.\r\nAl tratarse de un centro privado, ofrecemos una asistencia y atención completamente personalizada, basada en el respeto y cariño hacia todas las personas.\r\nLos servicios generales de nuestro centro residencial son:\r\n- Alojamiento temporal o permanente.\r\n- Alimentación balanceada.\r\n- Control médico y psicológico preventivo.\r\n- Apoyo espiritual.\r\n- Servicio de lavandería.\r\n- Contamos con personal técnico en geriatría y gerontología.', 'http://happyelder.pe/uploads/C5.jpg', 'publish', 'Avenida Jose Granda 2093 - San Martin de Porres', 'casa-de-reposo-dedik2-con-amor'),
(14, 'Casa de Reposo Lazos de Amor', 'Cuidamos al adulto mayor con mucho amor.\r\nOfrecemos:\r\n- Respaldo médico permanente.\r\n- Habitaciones individuales o compartidas.\r\n- Servicio de enfermería las 24 horas.\r\n- Aseo y confort.\r\n- Alimentación balanceada.\r\n- Servicio de lavandería.\r\n- Ambiente familiar.\r\n- Médico de Padomi (ESSALUD).\r\n- Terapia ocupacional y recreativa.\r\n- Jardines (interior y exterior).', 'http://happyelder.pe/uploads/C6.JPG', 'publish', 'Avenida de la Policía 581 Jesus Maria - Lima', 'casa-de-reposo-lazos-de-amor'),
(15, 'Hogar Geriátrico Ángel Cuidador', 'Hogar que brinda cariño y respeto al adulto mayor con una cálida atención ofreciéndole un ambiente familiar.\r\nHogar que brinda cariño y respeto al adulto mayor con una cálida atención ofreciéndole un ambiente familiar que lo hará sentirse como en casa.\r\nPonemos a su disposición profesionales con una alta vocación de servicio, ambientes agradables y acogedores.\r\n\r\nBrindamos los mas excelentes Servicios:\r\n\r\n. Personal especializado.\r\n. Terapia ocupacional.\r\n. Alimentación balanceada.\r\n. Alojamiento en habitaciones limpias y acogedoras.\r\n. Apoyo espiritual.\r\n. Servicio de lavandería.\r\n. Consultas médicas a domicilio (previa cita).\r\n. Administración de medicamentos.', 'http://happyelder.pe/uploads/C7.jpg', 'publish', 'Pasaje Mazzini Asoc. de Viv. Montecarlo 2da. etapa Mz. H Lt. 5  San Martin de Porres - Lima', 'hogar-geriatrico-angel-cuidador'),
(16, 'Los Años Maravillosos', 'Somos una empresa dedicada a la atención y cuidado del adulto mayor, pacientes con alteraciones mentales, que brinda una atención integral con calidad, calidez y eficiencia para mantener saludables a nuestros seres queridos.\r\n\r\nBrindamos instalaciones amplias, adecuadas y seguras dándole a usted la tranquilidad que necesita al encomendarnos su ser querido.\r\n\r\nAtendemos pacientes:\r\n- Geriátricos.\r\n- Operados.\r\n- Total y parcialmente postrados.\r\n- Psiquiátricos (con distintos cuadros de la enfermedad).\r\n- Oncológicos.\r\n- Diabéticos.', 'http://happyelder.pe/uploads/C8.jpg', 'publish', 'Mz. L1 Lt. 23 Urb. Santo Domingo 3ra Etapa (Av. Condorcanqui, alt. paradero Metropolitano)', 'los-anos-maravillosos'),
(17, 'Centro Residencial Geriátrico - Gerontológico y Casa de Reposo "Nuevo Amanecer"', '"Un Lugar de Garantía que le ofrece Calidad de Vida a la Tercera Edad"\r\nContamos Con Purificador de Aire, Asegurando un Ambiente Fresco y Saludable en los Pacientes \r\n\r\nNuestros Ambientes son Amplios, Limpios, Seguros, Cálidos y Hogareños, con Jardín y Seguridad.\r\n\r\nBRINDAMOS NUESTROS SERVICIOS PARA: \r\n\r\n- Adulto Mayor y no Mayor\r\n- Personas con Invalidez Física\r\n- Pacientes Post-Operados y Postrados en Cama\r\n- Enfermedades Crónicas y Convalecientes\r\n- Pacientes con Alzheimer\r\n- Pacientes con Demencia Senil\r\n- Parkinson\r\n- Infarto Cerebral - Embolia Cerebral - Hemiplejias', 'http://happyelder.pe/uploads/C9.JPG', 'publish', 'Jiron Caraz 996 Urb. Covida (Altura Cdra. 9 Av. Antúnez de Mayolo)  Los Olivos - Lima', 'centro-residencial-geriatrico-gerontologico-y-casa-de-reposo-nuevo-amanecer'),
(18, 'Asilo 1', '1', 'http://happyelder.pe/uploads/C2.jpg', 'publish', 'Pasaje Mazzini Asoc. de Viv. Montecarlo 2da. etapa Mz. H Lt. 5  San Martin de Porres - Lima', 'asilo-1');
